        log(`Loading level ${levelId}`);
        this.unloadCurrentLevel();
        const levelController = ECS.getComponent(this.levelControllerEntity, "LevelController");
        levelController.currentLevel = levelController.loadLevel;
        this.loadLevelObjects(levelId);
    }
    loadLevelObjects(levelId) {
        const level = levels.find((l)=>l.id === levelId);
        if (!level) {
            log(`Level ${levelId} not found`);
            return;
        }
        ECS.forEachEntity([
            "Player",
            "Sprite",
            "Animation",
            "PlayerScale"
        ], (entity, player, sprite, animation, playerScale)=>{
            player.position = {
                ...level.playerStartPosition
            };
            sprite.position = {
                ...level.playerStartPosition
            };
            player.velocity = {
                x: 0,
                y: 0
            };
            player.path = [];
            player.currentPathIndex = 0;
            animation.currentAnimation = "idle";
            player.navMeshIndex = level.playerNavMeshIndex;
            playerScale.min = level.playerScale.min;
            playerScale.max = level.playerScale.max;
            playerScale.quarterScreenMin = level.playerScale.quarterScreenMin;
            sprite.flipX = level.playerFacing === "left";
        });
        level.objects.forEach((obj)=>{
            const entity = ECS.createEntity();
            if (obj.type === "background") {
                ECS.addComponent(entity, "Tag", "Background");
                ECS.addComponent(entity, "Sprite", {
                    position: obj.position,
                    spriteIndex: obj.spriteIndex,
                    spriteSheet: obj.spriteSheet,
                    flipX: false,
                    origin: obj.origin,
                    size: obj.size
                });
                ECS.addComponent(entity, "Render", {
                    layer: RenderLayer.Background
                });
            }
            if (obj.type === "sprite") {
                ECS.addComponent(entity, "Sprite", {
                    position: obj.position,
                    spriteIndex: obj.spriteIndex,
                    spriteSheet: obj.spriteSheet,
                    flipX: false,
                    origin: obj.origin,
                    size: obj.size
                });
                ECS.addComponent(entity, "Render", {
                    layer: RenderLayer.Entities
                });
            }
            if (obj.type === "music") {
                ECS.addComponent(entity, "Music", {
                    musicId: obj.musicId
                });
                Sound.playSound(obj.musicId);
                Sound.setSoundVolume(obj.musicId, obj.volume);
            }
            if (obj.type === "particleEmitter") {
                if (obj.subType === "miasma") obj.positions.forEach((position)=>{
                    particlesSystem.addEmitter(createMiasmaEmitter(position));
                });
            }
        });
    }
    unloadCurrentLevel() {
        particlesSystem.clear();
        ECS.forEachEntity([], (entity)=>{
            if (ECS.getComponent(entity, "Music")) Sound.stopSound(ECS.getComponent(entity, "Music").musicId);
            if (ECS.getComponent(entity, "Sound")) {
                const soundComponent = ECS.getComponent(entity, "Sound");
                for(const soundKey in soundComponent.sounds){
                    const soundData = soundComponent.sounds[soundKey];
                    Sound.stopSound(soundData.soundId);
                    soundData.isStopping = false;
                }
            }
            ECS.getComponent(entity, "Light");
            if (!ECS.getComponent(entity, "Persistent")) ECS.destroyEntity(entity);
        });
    }
}
const levelSystem = new LevelSystem();
function init() {
    Graphics.setTransparentColor(255);
    state.SPRITES = {
        CURSOR: 0
    };
    state.frameCount = 0;
    state.lastFPSUpdate = Date.now();
    state.currentFPS = 0;
    state.keyStates = {};
    state.mouseButtonStates = {};
    state.entities = new Entities();
    levelSystem.loadLevel("level1");
    state.systems = [
        levelSystem,
        drawSystem,
        movementSystem,
        animationSystem,
        particlesSystem,
        lightingSystem,
        soundSystem,
        debugSystem
    ];
    state.systems.forEach((s)=>{
        s.init && s.init();
    });
}
function update() {
    const currentTime = Date.now();
    const elapsed = currentTime - state.lastUpdateTime;
    if (elapsed >= state.FRAME_TIME) {
        state.frameCount++;
        if (currentTime - state.lastFPSUpdate >= 1000) {
            state.currentFPS = state.frameCount;
            state.frameCount = 0;
            state.lastFPSUpdate = currentTime;
        }
    }
    updateKeyStates();
    updateMouseStates();
    handleMouseClicks();
    state.systems.forEach((s)=>{
        s.update && s.update(state.FRAME_TIME);
    });
}
function draw() {
    const currentTime = Date.now();
    const elapsed = currentTime - state.lastDrawTime;
    Graphics.fillScreen(0);
    if (elapsed >= state.FRAME_TIME) {
        state.lastDrawTime = currentTime - elapsed % state.FRAME_TIME;
        state.color = (state.color + 1) % 255;
    }
    state.systems.forEach((s)=>{
        s.draw && s.draw(state.FRAME_TIME);
    });
    const mousePos = Input.getMousePos();
    Graphics.drawSprite(mousePos.x, mousePos.y, state.SPRITES.CURSOR, false, false);
}
globalThis.draw = draw;
globalThis.update = update;
globalThis.init = init;
function updateKeyStates() {
    Object.keys(state.keyStates).forEach((key)=>{
        if (state.keyStates[key] === 'pressed') state.keyStates[key] = 'held';
        else if (state.keyStates[key] === 'released') state.keyStates[key] = 'up';
    });
    updateSingleKeyState(1, Input.isKeyPressed(1));
    updateSingleKeyState(2, Input.isKeyPressed(2));
    updateSingleKeyState(4, Input.isKeyPressed(4));
    updateSingleKeyState(8, Input.isKeyPressed(8));
    updateSingleKeyState(32, Input.isKeyPressed(32));
}
function updateSingleKeyState(keyCode, isPressed) {
    if (isPressed) {
        if (state.keyStates[keyCode] !== 'held' && state.keyStates[keyCode] !== 'pressed') state.keyStates[keyCode] = 'pressed';
    } else if (state.keyStates[keyCode] === 'held' || state.keyStates[keyCode] === 'pressed') state.keyStates[keyCode] = 'released';
    if (state.keyStates[keyCode] === 'pressed' && keyCode === 32) {
        const levelComponent = ECS.getComponent(levelSystem.levelControllerEntity, "LevelController");
        if (levelComponent.currentLevel === "level1") levelComponent.loadLevel = "level2";
        else levelComponent.loadLevel = "level1";
    }
}
function updateMouseStates() {
    Object.keys(state.mouseButtonStates).forEach((button)=>{
        if (state.mouseButtonStates[button] === 'pressed') state.mouseButtonStates[button] = 'held';
        else if (state.mouseButtonStates[button] === 'released') state.mouseButtonStates[button] = 'up';
    });
}
function handleMouseClicks() {
    const button = 0;
    const isPressed = Input.isMouseButtonPressed(0);
    if (isPressed) {
        if (state.mouseButtonStates[0] !== 'held' && state.mouseButtonStates[0] !== 'pressed') state.mouseButtonStates[button] = 'pressed';
    } else if (state.mouseButtonStates[0] === 'held' || state.mouseButtonStates[0] === 'pressed') state.mouseButtonStates[button] = 'released';
}
